import "./App.css";
import { useState } from "react";

function App() {

  const curtime = new Date().toLocaleTimeString();
  const [time, setCount] = useState( curtime );

  function updateTime() {
    let cur = new Date().toLocaleTimeString(); 
    setCount( cur );
  }

  setInterval( updateTime , 1000 );
  return (
    <div className="App">


      <h1>{ time }</h1>




    </div>
  );
}



export default App;
